def get_context_and_sources(key: str) -> tuple[str, list[str]]:
  """Extracts the context and concatenated sources for a given demo example."""
  info = MODEL_OUTPUTS[key]
  sources = []
  for tokens_and_log_probs in info['tokens_and_log_probs']:
    sources.append(''.join(token for token, _ in tokens_and_log_probs))
  return info['context'], sources


def get_context_and_token_probs(
    key: str,
) -> tuple[str, list[list[tuple[str, float]]]]:
  """Extracts the context and per-token log probs for a given demo output."""
  info = MODEL_OUTPUTS[key]
  return info['context'], info['tokens_and_log_probs']
